Hoy es #ArtFridayJaguar y y queremos compartir con ustedes esta obra de arte absolutamente impresionante por Dave Baranes @davebaranes, quien es un talentoso artista francés.
Esta obra de arte se titula "Hors Cadre".
El arte de Dave ilustra animales coloridos combinándolos con entornos ultraurbanos, mostrándonos el caos de este mundo, e inmediatamente nos hace cuestionar nuestra propia humanidad.
Creemos en el arte como una herramienta poderosa para difundir conciencia sobre el valor de la vida silvestre en todo el mundo.
Técnica: 140x140cm. Los fondos de sus pinturas están trabajados con técnicas de trampantojo, una inteligente mezcla de aerosoles y acrílicos para hacer graffiti.
Sin duda debes seguirlo, pinta muchas especies de vida silvestre y su trabajo es siempre ¡original e impresionante!. 🐆🎨🇫🇷
